import React, { Component } from 'react';
import Lollipop from './assets/pink-lollpop.jpeg';

const images = [
  Lollipop
]

class Content extends Component {
  constructor(props) {
    super(props);

    this.state = {
      imageSrc : ""
    }

  }

  componentDidMount() {
    this.setState({
      imageSrc: images[Math.floor(Math.random()*images.length)]
    })
  }



  render () {
    return (
      <img src={images[0]}/>
    )
  }
}

export default Content;
